using System.ServiceModel.Web;

namespace Hackathon.Web
{
    [ServiceContract(Namespace = "")]
    [AspNetCompatibilityRequirements(RequirementsMode = AspNetCompatibilityRequirementsMode.Allowed)]
    public class Services
    {
        [OperationContract]
        [WebGet(BodyStyle = WebMessageBodyStyle.Bare, ResponseFormat = WebMessageFormat.Json)]
        public DataObject[] GetData()
        {
            return RawData().Take(20).ToArray();
        }

        [OperationContract]
        [WebGet(BodyStyle = WebMessageBodyStyle.Bare, ResponseFormat = WebMessageFormat.Json)]
        public SlickGridWrapper<DataObject> GetDataForSlickGrid(string sidx, string sord, string aRequestParameter, int start, int limit, string Name, string Description, string NeedsRepair)
        {
            var data = RawData().AsQueryable();

            data = ApplySort(data, sidx, sord);

            if (!string.IsNullOrEmpty(Name))
            {
                data = data.Where(i => i.Name.Contains(Name));
            }
            if (!string.IsNullOrEmpty(Description))
            {
                data = data.Where(i => i.Description.Contains(Description));
            }
            if (NeedsRepair == "true")
            {
                data = data.Where(i => i.NeedsRepair);
            }
            
            var toReturn = data.Skip(start).Take(limit).ToArray();
            var count = data.Count();

            return new SlickGridWrapper<DataObject>()
            {
                start = start,
                results = toReturn,
                total = count,
            };

        }

        [OperationContract]
        [WebGet(BodyStyle = WebMessageBodyStyle.Bare, ResponseFormat = WebMessageFormat.Json)]
        public JQGridWrapper<DataObject> GetDataForJQGrid(string sidx, string sord, int rows, int page, string Description, string Name, string NeedsRepair)
        {
            var data = RawData().AsQueryable();

            data = ApplySort(data, sidx, sord);

            if (!string.IsNullOrEmpty(Name))
            {
                data = data.Where(i => i.Name.Contains(Name));
            }
            if (!string.IsNullOrEmpty(Description))
            {
                data = data.Where(i => i.Description.Contains(Description));
            }
            if (NeedsRepair == "true")
            {
                data = data.Where(i => i.NeedsRepair);
            }

            var toReturn = data.Skip((page-1)*rows).Take(rows).ToArray();
            var count = data.Count();

            return new JQGridWrapper<DataObject>()
            {
                records = toReturn.Length,
                rows = toReturn,
                page = page,
                total = (int)Math.Ceiling((decimal)count / rows),
            };
        }

        private IQueryable<DataObject> ApplySort(IQueryable<DataObject> data, string sidx, string sord)
        {
            switch (sidx + " " + sord)
            {
                case "Name asc":
                    data = data.OrderBy(i => i.Name);
                    break;
                case "Name desc":
                    data = data.OrderByDescending(i => i.Name);
                    break;
                case "RepairProbabilityInNext90Days asc":
                    data = data.OrderBy(i => i.RepairProbabilityInNext90Days);
                    break;
                case "RepairProbabilityInNext90Days desc":
                    data = data.OrderByDescending(i => i.RepairProbabilityInNext90Days);
                    break;
                case "CurrentValue asc":
                    data = data.OrderBy(i => i.CurrentValue);
                    break;
                case "CurrentValue desc":
                    data = data.OrderByDescending(i => i.CurrentValue);
                    break;
                case "NeedsRepair asc":
                    data = data.OrderBy(i => i.NeedsRepair);
                    break;
                case "NeedsRepair desc":
                    data = data.OrderByDescending(i => i.NeedsRepair);
                    break;
            }
            return data;
        }

        public class SlickGridWrapper<T>
        {
            public int start { get; set; }
            public T[] results { get; set; }
            public int total { get; set; }
        }

        public class JQGridWrapper<T>
        {
            public int page { get; set; }
            public int total { get; set; }
            public T[] rows { get; set; }
            public int records { get; set; }
        }

